  return (
    <div className='w-72 shadow-lg p-4 m-4'>
        <img className='rounded-xl' src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSNv6UrDN1cF3sRAgOn9jPLOiVkolfJfLScGw&s" alt="" />
        <h1 className='font-medium py-1'>{title}</h1>
        <div className='flex justify-between'>
        <h1 className=' text-slate-700 text-sm'>{channelTitle}</h1>
        <p className=' text-slate-700 text-sm'>10000 views</p>
        </div>

    </div>
  )
}

export default Videos
